from collections import deque

GRAPH_SIZE = 100
DIRECTION_LIST = [(0, 1), (0, -1), (-1, 0)]

T = 10

for case in range(1, T + 1):
    N = int(input())
    graphs = [list(map(int, input().split())) for _ in range(GRAPH_SIZE)]

    need_visited = deque([(GRAPH_SIZE - 1, graphs[GRAPH_SIZE - 1].index(2))])
    while need_visited:
        x, y = need_visited.popleft()

        if x == 0:
            print(f"#{case} {y}")
            break

        for dx, dy in DIRECTION_LIST:
            row, col = x + dx, y + dy
            if 0 <= row < GRAPH_SIZE and 0 <= col < GRAPH_SIZE and graphs[row][col] == 1:
                need_visited.append((row, col))
                graphs[row][col] = 0
                break

